use bevy::prelude::*;
use beet::{ BeetPlugin, Running, RunResult, SequenceSelector, SetOnRun
}; // actions are a component-system pair
#[Derive(Component, Action)]
#[action(system=log_on_run)]
pub struct LogOnRun(pub String); fn log_on_run(query: Query<&LogOnRun, Added<Running>){ for (action) in query.iter(){ println!("{}", action.0); }
} fn main(){ let mut app = App::new(); // the BeetPlugin adds the systems associated with each action, // as well as utility systems that clean up run state app.add_plugins(BeetPlugin::<( SequenceSelector, LogOnRun, SetOnRun, )>::default()); // behavior graphs are regular entity hierarchies! app .world_mut() .spawn((SequenceSelector::default(), Running)) .with_children(|parent| parent.spawn(( LogOnRun("Hello"), SetOnRun(RunResult::Success) )); parent.spawn(( LogOnRun("World"), SetOnRun(RunResult::Success) )); ); // all actions are run in parallel so each update is a tick // 1. Selector chooses first child app.update(); // 2. First child succeeds app.update(); // "Hello" // 3. Selector chooses second child app.update(); // 4. Second child succeeds app.update(); // "World" // 5. Selector succeeeds app.update();
}
